import React, { Component } from 'react';
import { css } from 'emotion';
import bgImage from '../../images/title-bg.jpg';

export default class Nav extends Component {
    render() {
        return (
            <div className={main}>
                NAV BAR
            </div>
        )
    }
}

const main = css`
    height: 7vh;
    width: 100vw;
    background-image: url('${bgImage}');
    background-size: 100% 100%;
`
